  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this plan is to provide
  an overall description of the Tamarac National Wildlife Refuge (NWR) trapping program,
  and its relationship to other programs. The plan provides specific guidance for
  administering the recreational/commercial trapping program of the White Earth Band
  of Chippewa Indians on the refuge, and contains guidelines for other trapping that
  may be conducted by refuge staff or permittees. The plan also serves as a vehicle
  for management approval of the program. The Environmental Assessment, Finding of
  No Significant Impact (FONSI), and the Environmental Action Memorandum are included
  in this document.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
